import React, { Component } from 'react'

const INITIAL_STATE = {} 
class Articles extends Component {
    constructor(props) {
        super(props);
        this.state = {
            articles: [],
            filterArticle: "",
            filter: "",
            isLoaded: "",
            error: {},
        }
    }

    componentDidMount() {
        fetch("http://henri-potier.xebia.fr/books")
            .then()
            .catch(err => this.setState())
    }

    render() { 
        return ( <div>Jojo</div> );
    }
}
 
export default Articles;
